import React from 'react';
import logo from './image/pic1.png';

function NavBar() {
  return (
    <div className="absolute h-full w-80 bg-yellow-400">
      <div>
        <img src={logo} alt="logo" />
      </div>
    </div>
  )
}

export default NavBar
